import './App.css';
import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Navbar from './components/Navbar';
import Home from './components/Home';



function App() {
  return (
    <>
<Router>
    <Navbar/>
    <Home/>
    <Switch>
          <Route path="/">
            <Home />
          </Route>

          <Route exact path="/about">
            <About />
          </Route>
    </Switch>
</Router>
    </>
  );
}

export default App;
